import React from "react";

const userInfo = [
  {
    id: 1,
    name: "_yum_s",
    time: "16분 전",
    src: "data:image/jpeg;base64,",
    alt: "user1",
  },
  {
    id: 2,
    name: "drink_eat_drink",
    time: "3시간 전",
    src: "data:image/jpeg;base64,",
    alt: "user2",
  },
  {
    id: 3,
    name: "hyukyc",
    time: "20시간 전",
    src: "data:image/jpeg;base64,",
    alt: "user3",
  },
  {
    id: 4,
    name: "jimikeek",
    time: "10시간 전",
    src: "data:image/jpeg;base64,",
    alt: "user4",
  },
];

const StoryUser = () => {
  return (
    <>
      {userInfo.map((el) => (
        <div className="storyUserContent">
          <img
            src="data:image/jpeg;base64,"
            alt="프로필"
          />
          <div className="storyUserContentText">
            <p>{el.name}</p>
            <p>{el.time}</p>
          </div>
        </div>
      ))}
    </>
  );
};

export default StoryUser;
